  return (
    <div
      style={{
        display: "flex",
        justifyContent: "space-between", // or "center"
        alignItems: "center",
        padding: "0 20px",
        maxWidth: "1200px",
        margin: "0 auto", // centers the nav on the screen
        width: "100%",
      }}
      onMouseOver={(e) => (e.currentTarget.style.transform = "scale(1.05)")}
      onMouseOut={(e) => (e.currentTarget.style.transform = "scale(1)")}
    >
      {picture ? (
        <img
          src={picture}
          alt={title}
          width="500"
          height="333"
          style={{
            borderRadius: "10px",
            maxHeight: "100px",
            maxWidth: "100px",
          }}
        />
      ) : (
        <div style={{ fontSize: "100px", textAlign: "center" }}>ðŸ˜º</div>
      )}
      <h3>{title}</h3>
      <p>{content}</p>
    </div>
  );
}

function MiniCard({ title, link }) {
  return (
    <div>
      <button
        style={{
          backgroundColor: "darkcyan",
          borderRadius: "8px",
          fontWeight: "lighter",
          color: "whitesmoke",
          padding: "15px 30px",
          border: "2px solid lightgray",
          border: "none",
        }}
      >
        <a href={link} style={{ color: "#FFFFF0", fontWeight: "lighter" }}>
          {title}
        </a>
      </button>
    </div>
  );
}

function PinkCard({ title, content, link }) {
  return (
    <a
      href={link}
      style={{ textDecoration: "none" }}
      target="_blank"
      rel="noopener noreferrer"
    >
      <div
        style={{
          minWidth: "200px",
          maxHeight: "150px",
          border: "none",
          padding: "20px",
          margin: "10px",
          borderRadius: "0px 15px 15px 0px",
          backgroundColor: "rgb(247, 234, 236)",
          borderLeft: "3px solid #FF5E00",
          boxShadow: "0px 4px 5px rgba(0, 0, 0, 0.3)",
          cursor: "pointer",
          transition: "transform 0.2s ease-in-out",
          minHeight: "150px",
        }}
        onMouseOver={(e) => (e.currentTarget.style.transform = "scale(1.05)")}
        onMouseOut={(e) => (e.currentTarget.style.transform = "scale(1)")}
      >
        <h3 style={{ color: "#FF5E00" }}>{title}</h3>
        <p style={{ fontWeight: "normal", color: "black" }}>{content}</p>
      </div>
    </a>
  );
}

